def sum_of_squares(n):
	sum = 0
	for i in range(1, n + 1):
		sum += i ** 2
	return sum

def sum_of_cubes(n):
	sum = 0
	for i in range(1, n + 1):
		sum += i ** 3
	return sum

def factorial(n):
	result = 1
	for i in range(2, n + 1):
		result *= i
	return result

def sum_of_even_numbers():
	sum = 0
	for i in range(2, 11, 2):
		sum += i
	return sum

def sum_up_to_ten():
	sum = 0
	for i in range(1, 11):
		sum += i
	return sum

def reverse_number(number):
	reverse = 0
	while number != 0:
		reverse += number % 10 * 10
		number //= 10
	return reverse

def count_digits(number):
	count = 0
	while number != 0:
		count += 1
		number //= 10
	return count
